    false,nt"url": null,nt"notes": "This project was part of a larger international
    project (SPLASH) designed to estimate the abundance and determine the population
    structure for humpback whales throughout the North Pacific involving the governments
    of Canada and Mexico as well as multiple agencies within the government of the U.S.
    The primary study methods were photo-identification and biopsy sampling. Passive
    acoustics were used to aid in finding aggregations of whales. In addition, biological
    and oceanographic data were collected to better characterize the whaleu00e2u0080u0099s
    environment, and survey data were collected for all other cetacean and pinniped
    species observed. Biopsy samples were also taken from other cetacean species, primarily
    in areas where they have been poorly sampled in the past. The Hawaiian Island Humpback
    Whale Sanctuary (HIHWS) collaborated on this cruise by sending two skilled photographers
    on each leg of survey effort. The U.S. Navy collaborated on this cruise by funding
    the acoustic and oceanographic sampling.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
